import React from "react";
// import "./CssStyle.css";

const heading = {
  textAlign: "center",
  color: "red",
  backgroundColor: "black",
  padding: " 10px",
  border: "2px solid yellow",
  paddingLeft: "50px",
};
const list = {
  textAlign: "center",
  margin: "10px",
  paddingLeft: "50px",
  backgroundColor: "brown",
  color: "white",
  fontSize: "larger",
  listStyle: "none",
};

const CssStyle = () => {
  return (
    <>
      <h1 style={heading}>Netflix App</h1>
      <p
        className="my"
        style={{ fontSize: "larger", fontWeight: "bolder" }}
        style={heading}
      >
        List of Netflix WebSeries
      </p>
      <ol style={list}>
        <li>Money Heist</li>
        <li>Dark</li>
        <li>Kantara</li>
        <li>Kgf 2</li>
        <li>Hum Tum</li>
      </ol>
    </>
  );
};

export default CssStyle;
